<node COLOR="#ff3333" CREATED="1450162580612" ID="ID_1227130787" MODIFIED="1450162971784" TEXT="fileMode ">
<node CREATED="1450162633257" ID="ID_680222719" MODIFIED="1450162665041" TEXT="Similar to a UNIX permission, sets the file mode of the files included. "/>
<node CREATED="1450162665042" ID="ID_1602535127" MODIFIED="1450162670112" TEXT="THIS IS AN OCTAL VALUE. Format: (User)(Group)(Other) where each component is a sum of Read = 4, Write = 2, and Execute = 1. ">
<node CREATED="1450162670116" ID="ID_812125019" MODIFIED="1450162795065" TEXT="For example, the value 0644 translates to User read-write, Group and Other read-only. The default value is 0644 (more on unix-style permissions)  ">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      default value 0644:
    </p>
    <ul>
      <li>
        <font color="#003333">user</font>&#160;- read/write&#160;&#160;
      </li>
      <li>
        <font color="#003366">group/other </font>- readonly
      </li>
    </ul>
  </body>
</html></richcontent>
</node>
</node>
</node>
<node COLOR="#9900cc" CREATED="1450162611279" ID="ID_176060429" MODIFIED="1450162963967" TEXT="directoryMode">
<node CREATED="1450162642417" ID="ID_1739811825" MODIFIED="1450162681768" TEXT=" Similar to a UNIX permission, sets the directory mode of the directories included."/>
<node CREATED="1450162681768" ID="ID_1901702144" MODIFIED="1450162792087" TEXT=" THIS IS AN OCTAL VALUE. Format: (User)(Group)(Other) where each component is a sum of Read = 4, Write = 2, and Execute = 1.">
<node CREATED="1450162685803" ID="ID_1021676796" MODIFIED="1450162863208" TEXT=" For example, the value 0755 translates to User read-write, Group and Other read-only. The default value is 0755. (more on unix-style permissions)  ">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      default value 0755
    </p>
    <ul>
      <li>
        <font color="#003333">user</font>&#160;- read/write/execute&#160;&#160;
      </li>
      <li>
        <font color="#003366">group/other </font>- read/execute
      </li>
    </ul>
  </body>
</html></richcontent>
